import React from "react";
import { Link } from "react-router-dom";

const Habit = (props) => {
  console.log(props.habit);
  return (
    <tr>
      <td>{props.habit.name}</td>
      <td>{props.habit.datesCompleted.substring(0, 10)}</td>
      <td>{props.habit.duration}</td>
      <td>
        <Link to={"/edit/" + props.habit._id}>EDIT</Link> |{" "}
        <button onClick={() => props.deleteHabit(props.habit._id)} />
      </td>
    </tr>
  );
};

export default Habit;
